import "./App.css";
import ListTask from "./components/ListTask";
import React from "react";
import { Route, Routes, WithRo } from "react-router";
import Home from "./components/Home.component";

function App() {
  const RoutesPage = () => {
    return (
      <Routes>
        <Route path="/" component={<Home />} />
        <Route path="/TDList" component={<ListTask />} />
      </Routes>
    );
  };

  return (
    <div>
      <Home />
      <BrowserRouter>
        <RoutesPage />
      </BrowserRouter>
    </div>
  );
}

export default (App);
